import React, {useState } from 'react'


export default function ManyElemFormHook() {


    const [name, setName] = useState("a");
    const [age, setAge] = useState("0");
    const [gender, setGender] = useState("N");
    const [isErrorName, setIsErrorName] = useState(false);
    const [errorNameText, setErrorNameText] = useState("OK");
    const [isErrorAge, setIsErrorAge] = useState(false);
    const [errorAgeText, setErrorAgeText] = useState("OK");
    const [isErrorGender, setIsErrorGender] = useState("false");
    const [errorGenderText, setErrorGenderText] = useState("OK");

    function nameValidation(name) {
        if ((name.length < 2) || (name.length > 20)) {
            return "Za krótkie lub za długie imie";
        }
        else {
            return "OK";
        }
    }

    function ageValidation(age) {
        let iage = Number(age);
        if ((Number.isNaN(iage)) || (iage < 1) || (iage > 140)) {
            return "Błędne oznaczenie wieku: " + age;
        }
        else {
            return "OK";
        }
    }

    function genderValidation(gender) {
        if ((gender !== "K") && (gender !== "M")) {
            return "Błędne oznaczenie płci: " + gender + " (podaj 'K' albo 'M')";
        }
        else {
            return "OK";
        }
    }

    function handleSubmit(event) {

        let resultForName = this.nameValidation(this.state.name);
        if (resultForName !== "OK") {
            setIsErrorName(true); setErrorNameText(resultForName)
        }
        else {
            setIsErrorName(false); setErrorNameText("OK");
        }

        let resultForAge = this.ageValidation(this.state.age);
        if (resultForAge !== "OK") {
            setIsErrorAge("true"); setErrorAgeText(resultForAge);
        }
        else {
            setIsErrorAge(false); setErrorAgeText("OK");
        }

        let resultForGender = this.genderValidation(this.state.gender);
        if (resultForGender !== "OK") {
            setIsErrorGender(true); setErrorGenderText(resultForGender);
        }
        else {
            setIsErrorGender(false); setErrorGenderText("OK");
        }

        event.preventDefault();
    }

    return (

        <Container>

            <h2>Aplikacja demonstrująca okno z formularzem wieloelementowym z walidacją poprawności danych (HOOK)</h2>

            <Form onSubmit={handleSubmit}>

                <h3>Wynik wprowadzania danych: {name}, {age}, {gender}</h3>

                <Form.Group className="auto">
                    <Form.Label>Podaj imię:</Form.Label>
                    <Form.Control type="text" name='name' value={name} placeholder="" onChange={(e) => setName(e.target.value)} />
                    {isErrorName && (<div style={{ color: 'red' }}> <Form.Label>{errorNameText}</Form.Label> </div>)}
                </Form.Group>

                <div><p></p></div>

                <Form.Group className="auto">
                    <Form.Label>Podaj wiek:</Form.Label>
                    <Form.Control type="text" name='age' value={age} placeholder="" onChange={(e) => setAge(e.target.value)} />
                    {isErrorAge && (<div style={{ color: 'red' }}> <Form.Label>{errorAgeText}</Form.Label>
                    </div>)}
                </Form.Group>

                <div><p></p></div>

                <Form.Group className="auto">
                    <Form.Label>Podaj płeć:</Form.Label>
                    <Form.Control type="text" name='city' value={gender} placeholder="" onChange={(e) => setGender(e.target.value)} />
                    {isErrorGender && (<div style={{ color: 'red' }}> <Form.Label>{errorGenderText}</Form.Label> </div>)}
                </Form.Group>

                <div><p></p></div>

                <Button variant="primary" type="submit">  Potwierdź  </Button>
            </Form >
        </Container>

    );

}
